import React from 'react';
import './App.css';
import { Button } from '@material-ui/core'

class Test extends React.Component {
    constructor(props) {

    }

    handleClick = (e) => {
        console.log(e.currentTarget.id);
    }

    componentDidMount() {
        fetch('http://localhost:8080/greeting')
            .then((response) => {
                return response.json();
            })
            .then((myJson) => {
                console.log(myJson);
            });
    }

    render() {
        return (
            <div>
                <Button id="1" align="left" variant="contained" onClick={this.handleClick}>Click me!</Button>
                <Button id="2" align="right" variant="contained" onClick={this.handleClick}>Click me!</Button>
            </div>
        );
    }
}

export default Test;
